(48, 42, 6, 910484, '2020-06-27', 'Moderação', '<h2>Atenção Jogadores Maicezinhos,</h2>\r\n\r\n<p>\r\nDevido ao número de Players muito baixo,\r\nestamos abrindo vagas para novos candidatos à Equipe de Moderação Brasileira,\r\nno intuito de proporcionar um servidor cada vez mais limpo e organizado para todos vocês.\r\n</p>\r\n\r\n<p>\r\nAos que tiverem interesse no cargo, aconselho que leiam com bastante atenção cada\r\npalavra contida neste post para não cometerem erros.\r\n</p>\r\n\r\n<p>\r\n• Ser justo com todos jogadores MaiceMice.\r\n• Ter comportamento maduro e responsável.\r\n• Ter um bom português ao redigir textos.\r\n                   • Ter conhecimento intermediário/avançado da língua inglesa.\r\n        • Ter mais de 100 queijos coletados em sua conta.\r\n</p>\r\n    \r\n<p>\r\nOs interessados que preencherem os pré-requisitos acima deverão encaminhar\r\num Formulario.\r\nÉ importante destacar que você deve colocar EXATAMENTE este assunto em seu email,\r\ncaso contrário, ele será descartado automaticamente.\r\n</p>\r\n\r\n<p>\r\nNeste Formulario, você deverá Responder todas as perguntas\r\nCom atenção de forma clara e objetiva.\r\n</p>\r\n\r\n<p>\r\n• Idade Verdadeira.\r\n• Nome / Sobre Nome.\r\n    • Nome utilizado em Jogo.\r\n• Data de Nascimento.\r\n</p>\r\n\r\n<p>\r\n• Qual seu Sexo ? " Masculino " " Feminino ".\r\n• Porque quer ser Moderador ?\r\n</p>\r\n\r\n<p>\r\nApós recebermos Formulario, iremos analisá-lo com atenção e,\r\ncaso seja aprovado, você passará para a 2º etapa do recrutamento,\r\nque constará de uma entrevista em jogo com um de nossos moderadores.\r\n</p>\r\n\r\n<p>Atenção:\r\n1º Envie o Formulario apenas 1 vez.\r\n2º Não enviem cochichos aos moderadores perguntando se leram seu Formulario. Isso resultará em eliminação imediata ao cargo.\r\n3º Certifique-se de que você tenha respondido todas as perguntas de forma clara e objetiva, Inclusive as não-relacionadas ao jogo, pois são tão importantes quanto as perguntas relacionadas ao jogo.\r\n</p>\r\n\r\n\r\n<p>\r\nA análise poderá demorar, por isso, não se precipite, tenha paciência.\r\nSó serão respondidos os e-mails que forem aprovados para a segunda etapa.\r\n</p>\r\n\r\n<p>Lembra-se! Enviar o Formulario: https://docs.google.com/forms/d/e/1FAIpQLSePB7xQ39kip-XIe2JjPYKVlSPSygowh8m5aP_khTz8i_2JeA/viewform\r\n</p>\r\n\r\n<p>No mais, desejamos uma boa sorte a todos os candidatos!</p>\r\n<p>Lucas Marginal</p>'),
(49, 44, 6, 910484, '2020-06-28', 'Moderação MaiceMice', '<h2>Atenção Jogadores Maicezinhos,</h2>\r\n\r\n<p>Devido ao número de Players muito baixo,\r\nestamos abrindo vagas para novos candidatos à Equipe de Moderação Brasileira,\r\nno intuito de proporcionar um servidor cada vez mais limpo e organizado para todos vocês.\r\n\r\nAos que tiverem interesse no cargo, aconselho que leiam com bastante atenção cada\r\npalavra contida neste post para não cometerem erros.\r\n\r\n• Ter comportamento maduro e responsável.\r\n• Ter um bom português ao redigir textos.\r\n• Ter conhecimento intermediário/avançado da língua inglesa.\r\n• Ter mais de 100 queijos coletados em sua conta.\r\n• Ser justo com todos os jogadores;\r\n    \r\nOs interessados que preencherem os pré-requisitos acima deverão encaminhar\r\num Formulario.\r\nÉ importante destacar que você deve colocar EXATAMENTE este assunto em seu email,\r\ncaso contrário, ele será descartado automaticamente.\r\n\r\nNeste Formulario, você deverá Responder todas as perguntas\r\nCom atenção de forma clara e objetiva.\r\n\r\n• Nome / Sobre Nome.\r\n• Nome utilizado em Jogo.\r\n• Data de Nascimento.\r\n• Sua cidade.\r\n• Qual seu Sexo ? " Masculino " " Feminino ".\r\n• Porque quer ser Moderador ?\r\n\r\nApós recebermos Formulario, iremos analisá-lo com atenção e,\r\ncaso seja aprovado, você passará para a 2º etapa do recrutamento,\r\nque constará de uma entrevista em jogo com um de nossos moderadores.\r\n\r\nAtenção:\r\n1º Envie o Formulario apenas 1 vez.\r\n2º Não enviem cochichos aos moderadores perguntando se leram seu Formulario. Isso resultará em eliminação imediata ao cargo.\r\n3º Certifique-se de que você tenha respondido todas as perguntas de forma clara e objetiva, Inclusive as não-relacionadas ao jogo, pois são tão importantes quanto as perguntas relacionadas ao jogo.\r\n\r\n\r\nA análise poderá demorar, por isso, não se precipite, tenha paciência.\r\nSó serão respondidos os e-mails que forem aprovados para a segunda etapa.\r\n\r\nLembra-se! Enviar o Formulario: https://docs.google.com/forms/d/e/1FAIpQLSePB7xQ39kip-XIe2JjPYKVlSPSygowh8m5aP_khTz8i_2JeA/viewform\r\n\r\nNo mais, desejamos uma boa sorte a todos os candidatos!</p>'),
(50, 45, 6, 910484, '2020-06-28', 'Moderação BR', '<h2>Moderação BR MaiceMice Transformice 2020</h2>\r\n\r\n<p><b>Atenção Jogadores Maicezinhos,</b></p>\r\n\r\n<p>\r\nDevido ao número de Players muito baixo,\r\nestamos abrindo vagas para novos candidatos à Equipe de Moderação Brasileira,\r\nno intuito de proporcionar um servidor cada vez mais limpo e organizado para todos vocês.\r\n</p>\r\n\r\n<p>\r\nAos que tiverem interesse no cargo, aconselho que leiam com bastante atenção cada\r\npalavra contida neste post para não cometerem erros.\r\n</p>\r\n\r\n<ul>\r\n<li>Ter comportamento maduro e responsável.</li>\r\n<li>Ter um bom português ao redigir textos.</li>\r\n<li>Ter conhecimento intermediário/avançado da língua inglesa.</li>\r\n<li>Ter mais de 100 queijos coletados em sua conta.</li>\r\n<li>Ser justo com todos os jogadores;</li>\r\n</ul>\r\n    \r\n<p>\r\nOs interessados que preencherem os pré-requisitos acima deverão encaminhar\r\num Formulario.\r\nÉ importante destacar que você deve colocar EXATAMENTE este assunto em seu email,\r\ncaso contrário, ele será descartado automaticamente.\r\n</p>\r\n\r\n<p>\r\nNeste Formulario, você deverá Responder todas as perguntas\r\nCom atenção de forma clara e objetiva.\r\n</p>\r\n\r\n<ul>\r\n<li>Nome / Sobre Nome.</li>\r\n<li>Nome utilizado em Jogo.</li>\r\n<li>Data de Nascimento.</li>\r\n<li>Sua cidade.</li>\r\n<li>Qual seu Sexo ? " Masculino " " </li>Feminino ".</li>\r\n<li>Porque quer ser Moderador?</li>\r\n</ul>\r\n\r\n<p>\r\nApós recebermos Formulario, iremos analisá-lo com atenção e,\r\ncaso seja aprovado, você passará para a 2º etapa do recrutamento,\r\nque constará de uma entrevista em jogo com um de nossos moderadores\r\n.</p>\r\n\r\n<p>\r\n<b>Atenção:</b>\r\n1º Envie o Formulario apenas 1 vez.\r\n2º Não enviem cochichos aos moderadores perguntando se leram seu Formulario. Isso resultará em eliminação imediata ao cargo.\r\n3º Certifique-se de que você tenha respondido todas as perguntas de forma clara e objetiva, Inclusive as não-relacionadas ao jogo, pois são tão importantes quanto as perguntas relacionadas ao jogo.\r\n</p>\r\n\r\n\r\n<p>\r\nA análise poderá demorar, por isso, não se precipite, tenha paciência.\r\nSó serão respondidos os e-mails que forem aprovados para a segunda etapa.\r\n</p>\r\n\r\n<p>\r\nLembra-se! Enviar o Formulario: <a href="http://maicemice.com.br/formulario.php" target="_blank">Formulario MaiceMice Moderador</a>\r\n</p>\r\n\r\n<p>\r\nNo mais, desejamos uma boa sorte a todos os candidatos!\r\n</p>\r\n\r\n<p><b>Postado por Lucas Marginal</b></p>'),
