(317, 574, 1, 'Bu subforum forum oyunları oynayabilmeniz içindir. Bu subforumun SuperMice ile alakalı olması gerekmez.\n\n[b]1. Xe kadar sayalım! oyunları yok.[/b]\nBu tür oyunlar için emek ve çaba sarfetmek gerekmez ve spam olarak nitelendirilirler. Bir oyun başlığına biraz düşünce katın.\n\n[b]2. Zaten var olan oyunun aynısını tekrar yaratmayın.[/b]\nLütfen bir oyun konusu açmadan önce açacağınız oyununuzun daha önce açılmamış olduğundan emin olun.\n\n[b]3. Bu konuda sadece forum oyunları konularını açabilirsiniz.[/b]\nBaşka şeyler hakkında konuşmak istiyorsanız Tartışmalar ya da Konu Dışı subforumlarını kullanabilirsiniz.\n\nSon olarak, unutmayın ki Forum Oyunları subforumunda da Genel Forum Kuralları geçerlidir.', 'Ciss', '1554146900000', '1554149991000', '0'),
(318, 575, 1, '[p=center][size=35][b][color=#30BA76]Kabile Tanıtım Konusu Oluşturmak[/color][/b][/size]\n[/p]\nBir kabile tanıtım konusunda nelere dikkat etmeniz gerektiğini, nelerden bahsetmek zorunda olduğunuzu ve bahsedebileceğiniz diğer bilgileri adım adım aşağıdan bulabilirsiniz. Kabile tanıtım konusu açmadan önce mutlaka aşağıdaki bilgileri okuyun!\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 1:[/color] [color=#30BA76]Kabile Adı[/color][/size][/b]\n\nKabilenizin adı konu başlığı olacağı dolayısıyla kabile adında hiçbir şekilde argo/küfür/ideolojik içerikli ibareler geçmemelidir. Konu başlıklarının başına &#34;[Kabile]&#34; etiketini yapmayı unutmayın tabi yapmayadabilirsiniz size kalmış.\n\n[quote=][Kabile] Apocalyptica\n[/quote]\n[quote=][Kabile] Athanasia\n[/quote]\n[hr]\n[b][size=17][color=#BABD2F]Adım 2:[/color]  [color=#30BA76]Kabile Logosu[/color][/size][/b]\n\nKabileniz için hazırlanmış bir logo veya hali hazırda kabilenizle ilişkili bir resim varsa konunun en başına o logoyu koyabilirsiniz. Bu sayede çok daha fazla farenin ilgisini çekmiş olacaksınız.\n\n[spoiler][p=center][img]https://i.hizliresim.com/RPRNGR.png[/img][/p][/spoiler]\nKabile tanıtım konunuz okunduğu zaman sıcak ve samimi bir kabile olduğunuzu kanıtlayın. Her fare, güzel bir hoşgeldin ile konunuzu okumaya başlamak ister.\n\n[quote=Kmlcan]Merhaba, ismi Athanasia olan kabilemin tanıtım konusuna hoş geldiniz.[/quote]\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 4:[/color]  [color=#30BA76]Misyon[/color][/size][/b]\n\nKabilenizin, bugün hangi konumda olduğunu, ne zaman kurulduğunu, kabilenizin adının neden XX olduğunu, ne yaptığınızı (kabile içi etkinlikler, sohbetler), kimin için ve kimlerle nasıl kurma kararı aldığınızı açıklayın.\n\n[quote=Apocalyptica]Kabilemiz 19.06.2017 tarihinde açılmış olup 06.07.2017 tarihinde faaliyete geçmiştir.[/quote]\n\n[quote=Apocalyptica]Kabilemizde eğlenceli aktiviteler bulunmaktadır bunların bazıları şunlardır kar topu savaşı, balık atma savaşı gibi..[/quote]\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 5:[/color]  [color=#30BA76]Vizyon[/color][/size][/b]\n\nKabilenizin ilerleyen zamanlarda nerede olmayı arzu ettiğini (hatta hayal ettiğini) anlatın. Dünya sıralamasında ilk 20&#39;ye girmek, minioyun veya modül oyun farelerinin hepsini toplamak veya en güzel arkadaş grubuna sahip olarak kıskanılacak bir düzeyde kabile olmak. Bu bölüm tamamen hayal gücünüzü devreye koymanız gereken bir bölüm.\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 6:[/color]  [color=#30BA76]Kurallar[/color][/size][/b]\n\nKabilenize katılacak bir oyuncunun kabile içerisindeyken takip etmesi gereken kurallar var ise yazmalısınız. Argo konuşmamak, kabile evinde çökertici haritalar açmamak, kabile evinde müzik açmak için sıra beklemek, kabiledekilerin odasına izinsiz gitmemek gibi.\n\n[quote=P R I V A C Y]• Kabile içerisinde Küfür/Argo, Spam/Flood kullanımı yasaktır.\n• Kabile üyeleri ile iyi geçinmeli, tartışmadan uzak durmalısınız.\n• Eğlenmeyi bildiğiniz kadar durmayı da bilmelisiniz.\n• Kabile içindeki luayı bozmamalısınız.\n• İzinsiz lua kodlaması yapmamalısınız[/quote]\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 7:[/color]  [color=#30BA76]Yetkili Listesi[/color][/size][/b]\n\nKabilenizin kim tarafından açıldığı ve kim(ler) tarafından yönetildiğini açıklayın. Bir kabileye katılmak istemenin en önemli sebebi sahip olduğu yöneticilerdir.\n\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 8:[/color]  [color=#30BA76]Katılım Koşulları ve Alım Yöntemleri[/color][/size][/b]\n\nHer kabilenin kendisine göre alım şartları vardır. Başvuran veya almak istediğiniz bir oyuncuyla daha sonra sorun yaşamamak adına oyuncuda belirli nitelikler arıyor olmalısınız; 18 yaşından büyük olmak, en az 1.000 birinciliğe sahip olmak, küfür etmemek, tamamen olgun bir kişiliğe sahip olmak gibi. \n\nKoşulları sağlayan oyuncuları neye göre alacağınızdan bahsedin. Kabile içi genel bir oylama yaptığınızdan bahsedebilir veya kabile içerisinde bir oyuncunun istemediği birini kabileye almadığınızı anlatabilirsiniz.\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 9:[/color]  [color=#30BA76]Rütbelendirme ve Fırsatlar[/color][/size][/b]\n\nKabilenize katılacak bir oyuncunun ne isimde rütbe-yetkilere ve kazanabileceği fırsatlara sahip olabileceğinden bahsedin. Her oyuncu katıldığı bir kabilede, en azından kabile evinde bir harita açma yetkisine sahip olmak ister. Ayrıca kabile içerisindeki durumuna göre terfi edebilecekleri durumlardan bahsedin. \n\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 10:[/color]  [color=#30BA76]Güncel Resimler veya Anılar[/color][/size][/b]\n\nKabilecek yaptığınız komik bir sohbetin, bir videonun, kabilecek tüm oyuncularla çekindiğiniz güncel bir resmin, bir ilginç anın veya sırf anı olsun diye çektiğiniz fotoğrafları konunuza ekleyebilirsiniz. Böylece kabilenizi daha çekici hale getirebilirsiniz.', 'Ciss', '1554146946000', '0', '0');
INSERT INTO `konu_mesajlari` (`konu_id`, `konu_mesaj_id`, `konu_mesaj_no`, `konu_mesaj_icerik`, `konu_mesaj_sahibi`, `konu_mesaj_tarih`, `konu_mesaj_s_d_t`, `konu_mesaj_durumu`) VALUES
(319, 576, 1, '[#Genel][color=#EDCC8D][size=25][b]Harita Editörü Bilgileri[/b][/size]\n[size=16]Harita editörü hakkında her şey.\n[/size][/color]\nBu konu harita yapımcılığı açısından sizlere yararlı bilgiler verir ve umarım bu bilgiler beceri ve bilgilerinizi geliştirmenizi sağlar. Harita editörü ile ilgili tüm merak ettiklerinizi bu konuda bulabilirsiniz. Eklenmesini istediğiniz bir bilgi veya hatalı bir bilgi var ise konuya mesaj atarak beyan edin. Bu konuya haritalar veya Supermice harita editörü ile ilgili dilediğiniz soruları sorabilirsiniz. \n\n[size=18][color=#98A697]İçindekiler[/color][/size]\n\n[size=15][color=#98A697]Sayfa 1[/color]\n[/size][*]Harita editörünü tanıyalım[/*]\n[*]Zeminler hakkında temel bilgiler[/*][*]Dinamik zeminler ve ayarları[/*]\n\n[size=15][color=#98A697]Sayfa 2[/color]\n[/size][list][*]Şaman eşyaları ve özellikleri[/*]\n[*]Yer çekimi ve rüzgar[/*][*]Harita ayarları[/*]\n[/list]\n[size=15][color=#98A697]Sayfa 3[/color]\n[/size][*]Harita arka planları[/*]\n[*]Harita ve Rotasyon türleri[/*][*]Haritalar neden silinir[/*]\n\n[size=15][color=#98A697]Sayfa 4[/color]\n[/size][*]Harita ekibi[/*]\n[*]Sizden gelenler, önemli konular ve videolar[/*]\n[img]https://i.hizliresim.com/7NnPAr.png[/img]\n[/#Genel]\n------------------------------------------------------------------------------------------------------\n[#Sayfa 1][size=18][b][color=#98a697]1. Harita editörünü tanıyalım[/color][/b][/size]\n\n[img align=left]https://i.hizliresim.com/Lnz1dz.png[/img]\nSupermice harita editörü, harita yapımcıları için kendilerine özel haritalar yapmak ve düzenlemek için önemli bir araçtır. Oyun içerisinde &#34;Menü düğmesi > Harita editörü&#34; şeklinde adımları takip ederek harita editörüne erişim sağlayabilirsiniz.\n\n\nBasit gibi görünse de harita editörü, pek çok işleve sahiptir. Yenilikçi kullanıcıların makinalar, heykeller, canavarlar ve dünyalar yaratmak için kullanabileceği bir ofistir burası.\n\n\n\n[b]Harita oylamaları:[/b] Bir harita yaptıktan sonra, haritanızı P0 olarak kayıt ederseniz normal odalarda çıkar ve harita süresi sonuna gelindiğinde haritanız oylamaya tabi tutulur. Eğer haritanız hayır oyları ile %50&#39;nin altına düşerse haritanız silinir ve bir daha normal odalarda çıkmaz.\n\n[b]Harita düzenleme:[/b] Haritanızı kayıt ettiğinizde sadece bir defa peynir karşılığında ücretlenir. Bunun dışında aynı harita üzerinde bir değişiklik yaparsanız herhangi bir peynir maaliyeti ile karşılaşmazsınız. \n\n[color=#98E2EB]Harita editöründe sadece kendi haritalarınızı yükleyebilirsiniz, başkasının haritalarını açmak için kabile evini kullanmanız gerekir.Herhangi bir haritayı kabilede açmak için[/color] [color=#BABD2F]/np @kod[/color]\n\n[size=15][color=#EDCC8D][b]Genel harita editörü detayları[/b][/color]\n[/size]\nBir harita yapmak için: Şimdiye kadar en az 1.000 peynir toplamış olmalısınız. \n\nHer harita başına 40 peynir ile ücretlendirilirsiniz.\n\nKorunmuş haritanız var ise harita yapma bedeli düşer: Her P1 haritası için 4 peynir, her P3-P9 haritası için 10 peynir düşürülür. \nÖrneğin 2 adet P1 haritası bulunan bir oyuncu 32 peynir fiyatına harita yapabilir. \n[hr]\n[size=18][b][color=#98a697]2. Zeminler hakkında temel bilgiler[/color][/b][/size] \n\nSupermice birçok farklı görünümlü haritalar oluşturmak için zeminler ve arka planlar kullanmanıza izin verir. Zeminlerin işlevi, haritalara göre farklılık gösterebilir özelliklere sahip.\n\nZeminlerin varsayılan özellikleri değiştirilirse, çikolata zeminlere tırmanamayabilir ve hatta lav zeminin üzerinde defalarca zıplayabilirsiniz.\n\nHerhangi bir zemin özelliğini düzenlemek, zemini konumlandırmak için zemine tıklayabilirsiniz. Tüm kullanılabilir özellikler ayarlar tarafta görünecektir. \n[img]https://i.hizliresim.com/YNLr3D.png[/img]\n\n[font=Lucida Console][size=12]T=&#34;0&#34; - Ahşap: Sürtünme (0.3) Zemin kavrama oranı (0.2)\nT=&#34;1&#34; - IBuz: Sürtünme (0) Zemin kavrama oranı (0.2)\nT=&#34;2&#34; - Trambolin: Sürtünme (0) Zemin kavrama oranı (1.2)\nT=&#34;3&#34; - Lav: Sürtünme (0) Zemin kavrama oranı (20)\nT=&#34;4&#34; - Çikolata: Sürtünme (20) Restitution (0.2)\nT=&#34;5&#34; - Toprak: Sürtünme (0.3) Zemin kavrama oranı (0.2)\nT=&#34;6&#34; - Çim: Sürtünme (0.3) Zemin kavrama oranı (0.2)\nT=&#34;7&#34; - Kum: Sürtünme (0.1) Zemin kavrama oranı (0.2)\nT=&#34;8&#34; - Bulut: Sürtünme (0.3) Zemin kavrama oranı (0.2) Farelerle etkileşimi yoktur.\nT=&#34;9&#34; - Su Sürtünme (0) Zemin kavrama oranı (0) Fareler yüzebilir.\nT=&#34;10&#34; - Taş: Sürtünme (0.3) Zemin kavrama oranı (0)\nT=&#34;11&#34; - Kar: Sürtünme (0.05) Zemin kavrama oranı (0.2)\nT=&#34;12&#34; - Renkli: Sürtünme (0.3) Zemin kavrama oranı (0.2) Düz zemin & Renklendirmeli\nT=&#34;13&#34; - Daire: Sürtünme (0.3) Zemin kavrama oranı (0.2) Daire & Renklendirmeli[/size]\n[/font]\n\n[img]https://i.hizliresim.com/WQv1WE.png[/img]\n\n[color=#BABD2F]Dikdörtgen ve daire hariç tüm zemin tiplerinin bulunduğu XML için:\n[/color]\n[spoiler][/spoiler]\n\n[color=#EDCC8D][b]Öğretici: XML dosyayı düzenleme - Değişen zeminler[/b]\n[/color]\nXML ile oynamak için, mutlaka not defteri veya wordpad gibi proğramlar kullanma alışkanlığınız olması gerekiyor. \n\nHaritanızın XML kodunu düzenlemek için, Supermice harita editörüne onu kopyalayıp yapıştırmak gerekir. Harita editörüne gelip Kaydet / Yükle / Test seçeneğine tıklayarak &#34;Haritayı Panoya Kopyala&#34; seçeneğine tıklayarak kopyalayın ve not defterine yapıştırıp kayıt edin. \n\nTemel bir şey ile başlayalım. Aşağıdaki kodda basit bir zemin ve fare doğuş alanı bulunmakta.\n\n[quote=Kod][font=Lucida Console][color=#2E72CB][/color]\n[/font][/quote]\nBurada daha açık bir şekilde yapısı gösterilen XML kodunun değişik bir gösterimi var.\n\n[img]https://i.hizliresim.com/8dvD0k.png[/img]\n\nHer zeminin kendi XML&#39;si vardır. Örnek XML&#39;miz sadece bir tane zemin içerir ([color=#EDCC8D]Sarı[/color] renkli). Bu zeminin (0.3) sürtünmesi ve (0.2) zemin kavrama oranı vardır. \n\nZemin düğümünde, zemin ile ilgili bir kaç özellikleri görebilirsiniz. Bunların yapısı genellikle bu gibi görünüyor:\n\n[font=Lucida Console][size=12]AttName=&#34;AttValue&#34;[/size]\n[/font]\nÖrneğin eğer bir zeminin türünü değiştirmek istiyorsanız, bunu dokusunu temsil eden T isimli niteliğinin değerini düzenlemek zorunda kalacaksınız. Yukarıda [color=#CB546B]kırmızı[/color] renk ile işaretlenmiştir.\n\nEğer [font=Lucida Console][color=#CB546B][size=12]T=&#34;0&#34;[/size][/color][/font] değerini [color=#CB546B][font=Lucida Console][size=12]T=&#34;9&#34;[/size][/font][/color] ile değiştirirseniz zemin buz haline dönecektir. \n\n[color=#EDCC8D][b]Sanat haritası oluşturmak: Bilgi ve klavuz[/b]\n[/color]\nSanat haritası oluştururken, zeminlerin düzgün şekilde hizalanmış olduğundan emin olmak gerekir ve normal bir odada düzgün çalışması gerekir. Yaptıklarınızı en iyi kabile evinde test edebilirsiniz.\n\n[b][color=#98A697]Harita yaparken göz önüne alınması gerekenler[/color]\n[/b]Popüler karakterler denemeyin, iyi bilinen (örneğin: Angry Birds, Supermen, Nyan Cat vb.) karakterleri haritanıza eklemeyin, bu dikkat çekmeyecektir. Bu yüzden harita tasarlarken benzersiz ve yaratıcı olmaya çalışın. \n(Sanatınıza güvenmemeye çalışın ve daha iyi oyun oynamak için bir şeyler ekleyin).\n\n[img align=left]https://i.hizliresim.com/OL69WP.gif[/img][b][color=#98A697]Zemin renklerini değiştirme[/color][/b]\nDaire ve renkli zeminin rengini değiştirebilmek için, zemine tıklatıp seçili hale getirin ve dahas onra ekranın sağ alt tarafında varsayılan zemin rengi ve renk kodu çıkar. Ona tıklayıp rengi değiştirebilirsiniz.\n\n[b][color=#98A697]Zeminler ve renk kodları[/color]\n[/b]\n[p=center][img]https://i.hizliresim.com/gW0VNb.png[/img][/p]\n\n[hr]\n\n[size=18][color=#98A697][b]3. Dinamik zeminler ve ayarları[/b][/color][/size]\n\nBir zemine tıkladıktan sonra &#34;Dinamik zemin&#34; seçeneğini işaretleyerek zemini dinamik zemin haline getirebilirsiniz. Zemin ayarlarının bir listesi aşağıda:\n[list]\n[*][color=#EDCC8D]Ağırlık:[/color] Zeminin ağırlığını ayarlamaya yarar. Ağır olan zemin daha hızlı düşer.[/*][*][color=#EDCC8D]Sürtünme[/color]: Zeminin sürtünme ayarıdır. Sürtünme 0 iken zemin kayganlaşır ve tırmanma olmaz.[/*][*][color=#EDCC8D]Zemin kavrama oranı(zıplatma):[/color] Farelerin zemine çarptığında ne kadar yükseğe zıplayacaklarını ayarlar. Ahşap ve toprak zeminin zıplatma oranı 0.2, trambolin zeminin 1.2, lav 20&#39;dir.[/*][*][color=#EDCC8D]Açı:[/color] Bir zeminin açısını ayarlar. Zemininizi değişik durumlarda durmasını sağlar. Maksimum 9999&#39;dur.[/*][*][color=#EDCC8D]Sabit açı:[/color] Eğer 1 yaparsınız, zemin bıraktığınız açıda hareket eder ve açı hiç bir zaman değişmez. Sadece 0 ve 1 kullanılabilir.[/*][*][color=#EDCC8D]Çizgisel düşüş:[/color] Hareketli zeminizin yere düşüş hızını ayarlar.[/*][*][color=#EDCC8D]Açısal düşüş:[/color] Hareketli zemininizin açısal düşüş hızını ayarlar. (Açısının bozulma hızı)[/*][*][color=#EDCC8D]Farelerle çarpışma:[/color] Obje veya zeminlerin sadece fareler ile etkileşimde bulunmasını sağlar.[/*][*][color=#EDCC8D]Zeminlerle çarpışma:[/color] Obje veya zeminlerin sadece zeminler veya objeler ile etkileşimde bulunmasını sağlar.[/*]\n[/list]\n[/#Sayfa 1]\n-----------------------------------------------------------------------------------------------------\n[#Sayfa 2][size=18][b][color=#98a697]4. Şaman eşyaları ve özellikleri[/color][/b][/size]\nAşağıdaki listede tüm mevcut şaman nesnelerini ve özelliklerini göreceksiniz.\n\n[img]https://i.hizliresim.com/Ddb9Xv.png[/img]\n[b]1. Top [/b]\nÇok hafiftir, üzerine basan fareleri zıplatır. \n\n[img]https://i.hizliresim.com/nW62YV.png[/img]\n[b]2. Trambolin[/b]\nÜzerine basan fareyi zplatma özelliğine vardır, ancak şaman objelerinde fazla bulunmaz genellikle haritalar üzerinde bulunur.\n\n[img]https://i.hizliresim.com/PrWBv5.png[/img]\n[b]3. Balon[/b]\nBu nesne hareketli zeminleri, nesneleri veya fareleri kaldırma gücüne sahiptir. 2 tane balon bir örsü kaldırabilecek güce sahiptir. Basınca bağlı olarak üzerinde 3 ila 10 arasında fare var ise patlayabilir.\n\n[img]https://i.hizliresim.com/ERdpbz.png[/img]\n[b]4. Gizemli işaret[/b]\nSürekli hareket halinde bulunan turkuvaz renge ve itme gücüne sahip olan bir nesnedir.\n\n[img]https://i.hizliresim.com/1gWr4B.png[/img]\n[b]5. Küçük ve büyük kutu[/b]\nBoyutlarına göre küçük ve büyük kutu olmak üzere iki tane kutu vardır. Şaman objelerinin vazgeçilmez bir öğesi olup; küçük kutu çok hafif, büyük kutu ise küçük kutuya nazaran daha ağırdır.\n\n[img]https://i.hizliresim.com/Q73WJj.png[/img]\n[b]6. Örs[/b]\nEn ağır şaman objesidir. \n\n[img]https://i.hizliresim.com/zBkYmR.png[/img]\n[b]7. Kısa ve uzun kalas[/b]\nŞaman objeleri içinde bir çok işleve sahip olan en önemli öğe diyebiliriz. Harita üzerinde köprüler kurmak, yollar yapmak için kullanılır. Kısa kalas hafif, uzun kalas daha ağırdır.\n\n[img]https://i.hizliresim.com/LnzEaV.png[/img]\n[b]8. Çiviler[/b]\nNesneleri birbirine bağlamak için kullanılır.\n3 tane çivi tipi vardır. Bunlar kırmızı, sarı ve yeşil çivilerdir.\nKırmızı çiviler sabitler.\nYeşil çiviler iki öğeyi birbirine bağlar, tıpkı bir eklem gibi alabileceği açı kadar objelerin dönmesine izin verir.\nSarı çiviler iki öğeyi birbirine bağlar.\n\n[img]https://i.hizliresim.com/Q73Wlg.png[/img]\n[b]9. Dönen çiviler[/b]\nKırmızı ve yeşil çivi olmak üzere iki türlüsü vardır. Biri saat yönünde, diğeri saatin tersi yönünde döner.\n\nKırmızı çivi, bağlandığı nesneyi saat yönünde, \nYeşil çivi, bağlandığı nesneyi saatin tersi yönünde döndürür.\n\n[img]https://i.hizliresim.com/G0A5k3.png[/img]\n[b]10. Delik[/b]\nDelik, her haritanın önemli bir parçasıdır. Delik olmadan peynirin bir anlamı olmaz. Peynir taşıyan farelerin hedef noktasıdır.\n\n[img]https://i.hizliresim.com/N1BWWL.png[/img]\n[b]11. Peynir[/b]\nFarelerin en sevdiği besindir peynir. Tıpkı bir anahtar gibi olan peynir, farelerin yuvaya girmesine izin vermesi için önemlidir. Haritaların belli yerlerinde olur ve fareler onu almak için tüm engelleri aşmaya çalışır. Peynirsiz bir haritada deliğin olmasının çokta önemi yoktur.\n\n[img]https://i.hizliresim.com/vp2R8m.png[/img]\n[b]12. Fare doğuş alanı[/b]\nBir haritaya başlayan farelerin, nerede doğacağını ayarlamak amacı ile kullanılır. Harita yapımcısı tarafından nereye konulmuş ise, fareler oyuna oradan başlar.\n\n[img]https://i.hizliresim.com/BAQ48D.png[/img]\n[b]13. Şaman doğuş alanı[/b]\nFarelerin peynir alıp yuvaya girmesinde rol sahibi olan kişidir. Belirli güçlere sahiptir. Bu güçler yardımıyla farelerin peyniri alıp yuvaya girmesini sağlar. Bazı haritalarda iki tane şaman olabilir.\n\n[img]https://i.hizliresim.com/7NnPAa.png[/img]\n[b]14. Portallar [/b]\nMavi ve turuncu renk olmak üzere iki tane portal vardır. Bir portala giren kişi diğer portala ışınlanır. Eğer şaman sadece bir portal koyarsa işe yaramaz, çalışması için iki portalında kullanılması gerekir.\n[hr]\n\n[size=18][b][color=#98a697]5. Yer çekimi ve rüzgar[/color][/b][/size]\n\nYer çekimi: Yer çekimi varsayılan ayarı 0&#39;dır. Yer çekimini azaltmak için negatif değerleri kullanın. Yer çekimini güçlendirmek için ise pozitif değerleri kullanın. Yer çekimi artar ise, zeminlere tırmanmak zorlaşır.\n\nRüzgar: Rüzgarın varsayılan ayarı 0&#39;dır. Rüzgar sayesinde fare sağa veya sola doğru savrulmasını sağlar ve farenin harita içerisinde hareket etme gücü zayıflar. Negatif değerlerin kullanılması farenin sol tarafa, pozitif değerlerin kullanılması ise farenin sağ tarafa savrulmasına neden olur.\n[hr]\n\n[size=18][b][color=#98a697]6. Harita ayarları[/color][/b][/size]\n\nHarita editörünün bir kaç ayarı aşağıda listelenmiş halde bulunmaktadır. Dilediğiniz özelliği aktifleştirerek haritalarınızda kullanabilirsiniz. Şimdi sizlere bu ayarlardan bahsedeceğim.\n\n[size=15][color=#EDCC8D][b]Bölüm 1 - Çarpışma modu [/b][/color]\n[/size]\n\nÇarpışma modu her fareye kendi ağırlığını verir ve fareler birbirlerinin üstüne çıkmayı sağlar. Çarpışmalı haritaların galibi rastgele bir kişi olabilir, çünkü tamamen eğlence modudur. \n\nÖrnek XML:\n\n[font=Lucida Console][spoiler][size=10][/size][/spoiler][/font]\n\n[size=15][color=#EDCC8D][b]Bölüm 2 - Ruh ikizi [/b][/color]\n[/size]\n\nRuh ikizi modu aktif olan haritalarda rastgele iki fare birbirine pembe bir ip ile bağlanır. Birbirine bağlanan iki fare birlikte hareket etmek zorundadırlar, aksi halde birinciliği kaybedersiniz.\n\nÖrnek XML:\n\n[font=Lucida Console][spoiler][size=10][/size][/spoiler][/font]\n\n[size=15][color=#EDCC8D][b]Bölüm 3 - Gece modu [/b][/color]\n[/size]\n\nGece modu aktif olan haritalarda her taraf karanlık olur, sadece kendi farenizin bulunduğu yer küçük bir çember genişliğinde aydınlık olur. Çok az kalıcı gece modu haritası vardır, popüler değildir.\n\nÖrnek XML:\n[font=Lucida Console][spoiler][size=10][/size][/spoiler][/font]\n\n[size=15][color=#EDCC8D][b]Bölüm 4 - Portal modu[/b][/color]\n[/size]\n\nPortalların açıklamasını daha önce yapmıştık, bilmeyenler konuyu inceleyip bulabilirler. Tek fark haritanın kendisinde portal olmasıdır.\n\n\n[size=15][color=#EDCC8D][b]Bölüm 5 - Uzun haritalar (Kaydırmalı haritalar)[/b][/color]\n[/size]\n\nHaritanız yatay yönde kayar. Varsayılan harita uzunluğu 800&#39;dür. Maksimum harita uzunluğu 1600&#39;dür.\n\nÖrnek XML:\n\n[spoiler][font=Lucida Console][size=10][/size][/font][/spoiler]\n[/#Sayfa 2]\n----------------------------------------------------------------------------------------------------------------\n[#Sayfa 3][size=18][b][color=#98a697]7. Harita arka planları[/color][/b][/size]\n\nVarsayılan arka plan mavidir. Zaman zaman yeni arka planlar eklenir.\nAşağıda harita arka planlarının XML kodları görünecektir.[color=#CB546B]XML endeksleri[/color] ise bkz:\n\n[color=#606090][font=Lucida Console][size=10][/size][/font][/color]\n\n[b]F=&#34;0&#34; - Gündüz \nF=&#34;1&#34; - Şafak \n\n\nF=&#34;2&#34; - Alacakaranlık . \nF=&#34;3&#34; - Dolunay\n\n\nF=&#34;4&#34; - Cadılar Bayramı\nF=&#34;5&#34; - Noel\n\n\nF=&#34;7&#34; - Fırtına bulutları \nF=&#34;8&#34; - Fırtına bulutları 2\n[/b]\n[size=18][b][color=#98a697]8. Harita ve rotasyon türleri[/color][/b][/size]\n\nYaptığımız haritalar kendi içinde gruplara ayrılırlar. Örneğin sanatsal bir haritanın kategori sanat haritası, şamanlık gerektiren bir harita şaman haritası olabilir. İşte sizlerle harita türlerinden bahsedeceğim ve sizde bu bilgileri dikkate alarak yaptığınız haritanın türünü anlayabileceksiniz. Haritaları sınıflandırmanın sebebi, haritalarını kalıcı yapmak isteyenler tüm kategorideki haritaları bir yere yollayacağına, kategorilere ayrılarak harita ekibinin işini kolaylaştırma amaçlanmıştır. Bu sayede şaman haritaları ile ilgilenen bir harita ekibi üyesi şaman kategorisi için yollanmış bir haritaya bakacaktır. Haritalarınızı kalıcı yapmak istiyorsunuz sadece haritanızın kodunu aşağıda verilen rotasyon türleri verilen linklere tıklayarak haritanıza uygun kategoriyi seçip o konuya yollayın. Bir süre sonra konuya tekrar bakın ve harita ekibinin sizin haritanız hakkında dediklerini öğrenin.\n\n[size=15][color=#EDCC8D][b]Rotasyon türleri[/b][/color]\n\n[img]https://i.hizliresim.com/YNLJna.png[/img] [url=http://forum.supermice.net/topic?f=6&t=176]Bootcamp[/url]\n[img]https://i.hizliresim.com/2935L0.png[/img] [url=http://forum.supermice.net/topic?f=6&t=177]Şaman[/url]\n[img]https://i.hizliresim.com/ZEBJv0.png[/img] [url=http://forum.supermice.net/topic?f=6&t=178]Sanat[/url]\n[img]https://i.hizliresim.com/qWkRg3.png[/img] [url=http://forum.supermice.net/topic?f=6&t=179]Mekanizma[/url]\n[img]https://i.hizliresim.com/N1BWyN.png[/img] [url=http://forum.supermice.net/topic?f=6&t=180]Şamansız[/url]\n[img]https://i.hizliresim.com/jWOjEG.png[/img] [url=http://forum.supermice.net/topic?f=6&t=181]Çift Şaman[/url]\n[img]https://i.hizliresim.com/lWG9ol.png[/img] [url=http://forum.supermice.net/topic?f=6&t=182]Karışık[/url]\n[img]https://i.hizliresim.com/PrW64v.png[/img] [url=http://forum.supermice.net/topic?f=6&t=183]Survivor[/url]\n[img]https://i.hizliresim.com/VMnX5V.png[/img] [url=http://forum.supermice.net/topic?f=6&t=184]Vampir Survivor[/url]\n[img]https://i.hizliresim.com/MvGg5a.png[/img] [url=http://forum.supermice.net/topic?f=6&t=185]Racing[/url]\n[img]https://i.hizliresim.com/G0A2Q7.png[/img] [url=http://forum.supermice.net/topic?f=6&t=186]Defilante[/url]\n\nHarita türleri hakkında bilgiler yukarıda linkleri verilen konularda mevcuttur, bu yüzden kategoriler hakkında hali hazırda bilgiler varken kopyalayıp buraya yapıştırmanın bir gereği yoktur.\n\n[size=15][color=#EDCC8D][b]Diğer harita türleri[/b][/color]\n\n[img]https://i.hizliresim.com/MvGWn7.png[/img] Vanilla Haritası\nVanilla odalarında çıkan adminlerin yaptıkları haritalardır.\n\n[img]https://i.hizliresim.com/5Ql25A.png[/img] Standart Harita (P0)\nOyuncuların yaptığı, normal odalarda çıkan oylamaya açık haritalardır.\n\n[img]https://i.hizliresim.com/JlJ6PE.png[/img] Korunmuş Harita (P1)\nOylama ile %50&#39;nin altına düşüp silinmesine izin verilmeyen, oylamaya kapalı kaliteli haritalardır.\n\n[img]https://i.hizliresim.com/bGXYqY.png[/img] Silinmiş Harita (P44)\n%50 oy oranının altında oy almış haritalardır.\n\n[img]https://i.hizliresim.com/zBkY8B.png[/img] Kabile Evi Haritası (P22)\nKabile evi yapılabilen haritalardır.\n\n[size=18][b][color=#98a697]9. Haritalar neden silinir?[/color][/b][/size]\n[list]\n[*]Eğer haritanız 100 oy miktarını geçtikten sonra Evet/Hayır oranı %50&#39;nin altında kalmışsa, sunucu tarafından otomatik olarak silinir.[/*][*]Haritanız herhangi bir vanilla haritasının kopyası ya da çok benzeri ise, modlar tarafından tespit edildiği anda silinir.[/*][*]Haritanız daha önce herhangi bir oyuncu tarafından yapılmış bir haritanın benzeri ve ya kopyası ise, tespit edildiği anda modlar tarafından silinir.[/*][*]Haritanızdaki zemin en boy oranları aşırı yüksek ise ve bu yükseklik sonucu oyunda lag oluşuyorsa, haritanız modlar tarafından silinir.[/*][*]Haritanızda çok fazla hareketli zemin varsa ve bu zeminler de odanın sync senkronu nedeniyle bozuluyorsa, modlar tarafından silinir.[/*][*]Haritanızda bulunan zeminler, oyunu çökertebilecek bir şekilde dizilmişse (Paralel bir şekilde iki tane lava ve ya trambolin zemin koyarak) haritanız modlar tarafından silinir.[/*][*]Haritanızda tam ekran avantajı varsa tespiti halinde modlar tarafından silinir.[/*][*]Delik, peynir ve ya her ikisi de oyun alanının dışındaysa haritanız silinir.[/*][*]Delik ve peynir üst üste ise haritanız silinir.[/*][*]Çok fazla delik ve peynir varsa haritanız silinir.[/*][*]Şaman ve ya oyuncuların doğdukları yerler nedeniyle direk olarak ölüyorlarsa, haritalarınız silinir.[/*][*]Haritanız görüntüsü itibarı ile çok kötü ise modlar tarafından silinir.[/*][*]Haritanız ırkcı bir harita ise ve ya genel ahlak kurallarına aykırı bir harita ise silinir.[/*][*]Şamanın kapalı bir alanda sıkışıp kaldığı haritalar silinir.[/*][*]Daha fazla oynansın diye birden fazla yüklenen haritaların kopyaları silinir.[/*][/list]\n[/#Sayfa 3]\n---------------------------------------------------------------------------------------------------------------\n[#Sayfa 4][size=18][b][color=#98a697]10. Harita Ekibi[/color][/b][/size]\n\nHarita Ekibi, amacı haritaların kalitesini kontrol etmek olan, en önemlisi diğer harita yapımcılarına gerekli yardımı sağlayan bir grup harita yapımcılarından oluşan bir ekiptir. Harita ekibi üyeleri haritaları silebilir, kalıcı yapabilir ve kabile evine dönüştürebilir. Ayrıca harita ekibi üyelerinin haritalar hakkında tartışma yaptıkları özel forumu vardır.\n\nOnların iki ana görevi vardır: Harita rotasyonunun sorumluluğunu üstlenmek ve yaptığınız haritalar hakkında gerekli geribildirimi yapmaktır.\n\n\n[size=18][b][color=#98a697] 11. Sizden gelenler, önemli konular ve videolar [/color][/b][/size]\n\nBu bölümde sizlerin yaptığı faydalı eğitim videolarını, rehber konuları sergilenecektir. Zaman içerisinde güncellenecektir, sizinde haritalar veya harita editörü hakkında göndermek istediğiniz linkler varsa konuya mesaj atın. Gerekli görülenler eklenecektir. [color=#CB546B]Ayrıca bu bölüme sizlerin konuya mesaj atarak verdiğiniz bilgileri spoiler içerisinde de vereceğim.[/color]\n[/#Sayfa 4]', 'Ciss', '1554147081000', '0', '0'),
(320, 577, 1, '[font=Century Gothic][color=#BABD2F][p=center][size=30][b]Hayran Sanatları; Sorular ve Cevaplar Başlığı S.S.S[/b]\n[/color][/size]\n[color=#BABD2F][size=16][b]Bu konuda yeni ressamlara yardım edebilirsiniz *-*[/b]\n[/color][/size][/p]\n\n\n[color=#BABD2F][size=16][b]Nasıl sorumu sorabilirim?[/b][/size][/b]\n[/color][list][*]Özellikle bir soruya cevap vermek için, öncelikle cevabın doğru olup olmadığını kontrol edin.[/*][*]Bir soru sormak için net ve yazım hatalarına uygun soru sorarak sorunuzu açıklayıcı bir biçimde anlatabilir ve net bir cevap alabilirsiniz.[/*][/list]\n\n[color=#BABD2F]\n[p=center][size=25][b]Sıkça Sorulan Sorular[/b]\n[/size][/p]\n[/color][/b]\n[size=15][color=#BABD2F][img]http://i.hizliresim.com/5M386l.png[/img] [b]Çizim yapmak için hangi programlar kullanabiliriz?[/b]\n[/size][/color][spoiler][b]Animasyon:[/b][list][*][url=http://www.adobe.com/ch_fr/products/animate.html]Flash CS6[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][*][url=http://www.adobe.com/ch_fr/products/aftereffects.html]After effect CS6[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][*][url=http://www.gamani.com/]Gif movie Gear[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][/list]\n\n[b]Fotoğraf düzenleme:[/b][list][*][url=http://www.photofiltre-studio.com/]Photofiltre[/url] [size=10][color=#30BA76](Ücretsiz)[/color][/size][/*][*][url=http://www.photoscape.org/ps/main/index.php]Photoscape[/url] [size=10][color=#30BA76](Ücretsiz)[/color][/size][/*][*][url=http://www.adobe.com/ch_fr/products/photoshop.html]Photoshop CS6[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][/list]\n\n[b]Dijital, geleneksel çizim:[/b][list][*][url=http://www.painterartist.com/fr/product/painter/]Corel Painter[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][*][url=https://www.artrage.com/]ArtRage[/url] [size=10][color=#30BA76](Ücretsiz)[/color][/size][/*][/list]\n\n[b]Çizim programı:[/b][list][*][url=http://www.systemax.jp/en/sai/]Paint Tool SAI[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][*][url=http://www.adobe.com/ch_fr/products/photoshop.html]Photoshop CS6[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][*][url=https://www.gimp.org/]Gimp[/url] [size=10][color=#30BA76](Ücretsiz)[/color][/size][/*][*][url=http://blackink.bleank.com/]Black ink[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][*][url=https://www.getpaint.net/download.html]Paint[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][/list]\n\n[b]3D:[/b][list][*][url=http://pixologic.com/]Zbrush[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][*][url=https://www.autodesk.fr/products/maya/overview]Autodesk Maya[/url] [size=10][color=#CB546B](Ücretli)[/color][/size][/*][*][url=https://www.blender.org/]Blender[/url] [size=10][color=#30BA76](Ücretsiz)[/color][/size][/*][/list]\n\n[b]Pixel resim:[/b][list][*][url=https://graphicsgale.com/us/]GraphicGale[/url] [size=10][color=#30BA76](Ücretsiz)[/color][/size][/*][/list]\n[b]\nFilm programı:[/b][list][*][url=https://www.tamindir.com/camtasia-studio/]Camtasia Studio[/url] [size=10][color=#30BA76](Ücretsiz)[/color][/size][/*][*][url=https://www.tamindir.com/bandicam/]Bandicam[/url] [size=10][color=#30BA76](Ücretsiz)[/color][/size][/spoiler][/*][/list]\n\n\n[size=15][color=#BABD2F][img]http://i.hizliresim.com/5M386l.png[/img] [b]Paint tool sai programını nereden satın alabilirim?[/b]\n[/size][/color]Yazılımın resmi web sitesinde.[url=http://www.systemax.jp/en/sai/]Bu link[/url] 30 gün ücretsiz deneme sürümü erişebilirsiniz. Eğer program başlamazsa programa sağ tıklayıp &#34;Yönetici olarak çalıştır&#34; seçeneği ile programı açabilirsiniz.\n\n\n[size=15][color=#BABD2F][img]http://i.hizliresim.com/5M386l.png[/img] [b]Fırça Nedir?[/b]\n[/size][/color]Fırça, resim çizmek için kullanılmak için uygulanabilir bir görüntü şekildir.\n\n\n[size=15][color=#BABD2F][img]http://i.hizliresim.com/5M386l.png[/img] [b]Nasıl bir çizimi bilgisayara aktarabilirim?[/b]\n[/size][/color]Eğer bir tarayıcınız varsa, tarayıcı ile bilgisayara aktarabilir veya bir dijital kamera ile fotoğraf/görüntü çekip ya da USB kablosu ile SD kart üzerinden veya bilgisayarınıza resim aktarabilirsiniz.\n\n\n[size=15][color=#BABD2F][img]http://i.hizliresim.com/5M386l.png[/img] [b]Nasıl görüntümü net bir şekilde gösterebilirim[/b]\n[/size][/color]Boyutunu azaltmak veya düşük kalitede kaydetmek yeterli olacaktır. Genel olarak, biçim .jpg biçimi daha hafif .png kalitesi kötü olabilir.\n\n\n[color=#BABD2F][size=15][img]http://i.hizliresim.com/5M386l.png[/img] [b]Nasıl GIF(hareketli resim) yapabilirim?[/b]\n[/color][/size]Gif yapmak için birçok program bulunur. Adobe Photoshop CS6 ve Recordit gibi programları kullanarak GIF oluşturabilirsiniz. Eğer Gif yapmasını bilmiyorsanız [url=https://www.youtube.com/watch?v=xtH-FrWaC0Q]youtube[/url]&#39;da bulunan videoları izleyerek öğrenebilirsiniz.\n\n\n[size=15][color=#BABD2F][img]http://i.hizliresim.com/rZagnB.png[/img] [b]Nasıl film çekebilirim?[/b]\n[/size][/color]Film çekimi için de birçok program bulunmakta.En yaygın olan film çekimi programı Bandicam/Camtasia studio diyebiliriz.Bu programları kullanarak film çekebilirsiniz.\n\n\n[size=15][color=#BABD2F][img]http://i.hizliresim.com/5M386l.png[/img] [b]Kullanıcılar beni resim çizerken görebilir mi?[/b]\n[/size][/color]Evet,[url=https://www.join.me/]Join.me[/url] programı ile mümkün.Ayrıca Livestream gibi siteler ile oyuncular sizi izleyebilirler.\n\n\n[color=#BABD2F][size=15][img]http://i.hizliresim.com/5M386l.png[/img] [b]Nerede bir yazı gönderebilirim(kaydedebilirim)?[/b][/color][/size]\n[url=http://paste.moepl.eu/]Paste.moepl[/url] sitesinden kopyaladığınız metinleri burada gönderebilir veya kaydedebilirsiniz.[hr][p=center][color=#BABD2F][b]Önemli Konular[/b][/color][/p][p=center][url=http://forum.supermice.net/topic?f=6&t=3576]Tek Resim[/url]\n[url=http://forum.supermice.net/topic?f=6&t=3577  ]Bilgilendirme ve Kılavuz[/url][/p][hr][p=center]Bir sorunuz varsa hiç çekinmeden bu konu altından sorabilirsiniz.[/p]\n[/font]', 'Ciss', '1554147195000', '0', '0'),
(321, 578, 1, '[p=center][size=20][color=#EB1D51][b]Bağlantı Problemleri ve Oyuna Girememek[/b][/color][/size][/p]\n\nMerhaba,\nEğer bağlantı probleminiz varsa telaşa kapılıp forumda konu açmayın veya küfürlü yazılar yazmayın bazen sizin elinizde olmayan etkenler (sunucunun güncelleme için çevrimdışı olması gibi) de sorun yaratabilir dolayısıyla öncelikle birkaç saat bekleyin ve eğer problem hala devam ediyorsa bir yöneticiye başvurmaktan çekinmeyin. \n\n[b]Karşılaşabileceğiniz olası problemler:[/b]\n• Yüklenme ekranındaki çubuğun dolmaması, donup kalması, (çoğunlukla sunucuya bağlanılamaması sonucu)\n• Yüklenme ekranını geçtikten sonra &#34;sunucuyla olan bağlantınız kesildi&#34; yazısı,\n• Yükleme ekranını geçersiniz fakat şifre bölümünün altındaki oyuncu sayısını gösteren yazı görünmez, oyuna girerkenden bağlantınız kopar\n• Ekran karşınıza hiç çıkmaz (genellikle sunucunun yoğun/meşgul olmasından kaynaklanır)\n\n[b]Her şeyden önce denemeniz gereken olası çözümler:[/b]\n• Önbelleğinizi ve çerezleri temizleyin, en son Flash versiyonuna güncelleştirin.\n• Bilgisayarınızın veya routerinizin (yönlendirici) güvenlik duvarının bağlantıyı engellemediğinden emin olun.\n• http://downforeveryoneorjustme.com/supermice.net adresinden sunucunun çevrimdışı olup olmadığını kontrol edin. (It&#39;s up = sunucu çevrimiçi)\n• Lag olmadığından emin olun.\n• Etkileyebilecek herhangi bir programı kapatın.\n\n[color=#EB1D51][b]Unutmayın![/b][/color]\nEğer herhangi bir yere herhangi bir şekilde bağlantı kurabiliyorsanız denemeye devam edin, bazen sadece aşırı yoğunluk nedeniyle sunucudan kaynaklanır, eğer yüklenme ekranına gelmeyi başarabilirseniz sayfayı yenilemeye devam edin.\n\nLag yardımı: Ne kadar lag olduğunu etkileyen bir sürü faktör vardır, sahip olduğunuz ping size kötü bir bağlantı sağlar dolayısıyla lag olur, eğer pinginizi merak ediyorsanız http://pingtest.net/ adresinden Fransa sunucusunu (TR sunucu Fransa&#39;da) test ederek ne kadar pinge sahip olduğunuzu görebilirsiniz. (Yüksek ping = kötü, düşük ping = iyi)\n\nKablosuz bağlantının, bağlantılarınızda az da olsa etkisi vardır, iyi bir kablosuz bağlantı kartına sahip olduğunuzdan emin olun.\n\nVirüsler: Antivirüs programı kullanmak bilgisayarınızı virüslerden koruyacaktır. Birçok bedava antivirüs programı mevcuttur. Sürekli olarak sisteminize bakım yapmak da yararlı olacaktır.\n\nBilgisayarınızın yaşı: Çok da önemli gözükmese de bilgisayarınız çok eskiyse donanımı da eskidir yani yeni yazılımlardan, oyunlardan tam performans alamayabilirsiniz demektir. Dolayısıyla bağlantınızı suçlamadan önce bilgisayarınızın yaşını da göz önünde bulundurun.\n\nPerformans derecelendirmesi: Eğer Windows 7 işletim sistemini kullanıyorsanız Oyunlar (Games) klasörüne girin ve sağ alttaki puana bakın, eğer puanınız 4ün altındaysa demek ki bilgisayarınızın performansı düşüktür ve oyunlardan tam verim alamayacaksınız. Puanınızın 6 ve 7 civarında olması iyidir. (En yüksek mümkün puan 7.9dur sanırım)\n\nEğer oyuna bağlanmakta sorun yaşıyorsanız aşağıdaki formu kullanın.\n\n[quote=]Bu sorunu ne zamandan beri yaşıyorsunuz?:\nSize internet sunan şirketin adı nedir(ISP)?:\nResim:\nAynı internet bağlantısı üzerinde başka bir bilgisayar üzerinde oyunu oynamayı denediniz mi?:\nTarayıcıdan mı, standaloneden mi giriyorsunuz? Hangi tarayıcı/standaloneyi kullanıyorsunuz?:\n[/quote]\nOyuna bağlanamadığınız zamanlarda konu açmanıza gerek yok, buradan bilgi alıp tartışabilirsiniz.\n[/quote]', 'Ciss', '1554147247000', '0', '0'),
